System.register(["./common-legacy-b78b4441.js"],(function(A,i){"use strict";var R;return{setters:[A=>{R=A.c}],execute:function(){const i='<h1>个人对 webpack 的一些理解</h1>\n<h2>产生背景</h2>\n<ul>\n<li>\n<p>模块打包器，它的产生背景可以追溯到 Web 应用程序发展的早期阶段。在此前，Web 应用程序通常是由一些 HTML、CSS 和 JavaScript 文件组成的。这些文件之间的相互依赖关系很复杂，如果没有合适的管理工具，就很难维护这些文件。</p>\n</li>\n<li>\n<p>随着 Web 应用程序的复杂性不断增加，开发人员越来越需要一种前端构建工具来处理这些问题。Webpack 的产生就是为了解决这些问题。</p>\n</li>\n<li>\n<p>因此，Webpack 是一个为现代 Web 应用程序构建而生的工具，它可以帮助开发人员快速构建大型、复杂的应用程序，并使这些应用程序更容易维护和扩展。</p>\n</li>\n</ul>\n<h2>webpack 是什么？</h2>\n<p>Webpack 是一个开源的 JavaScript 应用程序打包工具。它主要用于将各种 JavaScript 文件（模块）打包成一个或多个文件，以及处理其他静态资源，如 HTML、CSS、图片和字体等。</p>\n<img src="data:image/png;base64," />\n<h2>如何使用？</h2>\n<pre><code>1. mkdir webpack-demo\n2. cd webpack-demo\n3. npm init -y\n4. npx webpack init\n\n</code></pre>\n',I=A("__default",R("intro","简介","/notes/webpack/intro",i)),E=[];A({page:E,default:E}),A("__module",R("intro","webpack",I.path,i,E))}}}));
